import './App.css';
import React from 'react';
import Home from './pages/Home';
import Header from './components/Header';
import {BrowserRouter, Routes, Route} from 'react-router-dom'



const App = () => {  


  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Home/>} />
      <Route path='/header' element={<Header/>} />
    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
